import React from "react";
import './style.css';

const Footer = () => {
  return (
    <footer>
      <span>Created with <span className="far fa-heart"></span> by <a>Varun Deep Saini</a> | No <span className="far fa-copyright"></span> copyright issues. Feel free to copy, if you need any help, ping me!</span>
    </footer>
  );
}

export default Footer;
